export default function Icon({ name }) {
  switch (name.toLowerCase()) {
    case "github":
      return <FiGithub />;
    case "twitter":
      return <FiTwitter />;
    case "email":
      return <FiMail />;
    case "code":
      return <FiCode />;
    case "blog":
      return <RiArticleLine />;
    case "profile":
      return <FiUser />;
    case "contacts":
      return <TiContacts />;
    case "close":
      return <MdClose />;
    case "left-arrow":
      return <FiChevronLeft />;
    case "right-arrow":
      return <FiChevronRight />;
    case "external-link":
      return <FiExternalLink />;
    case "check-circle":
      return <FaCheckCircle />;
    case "video-chat":
      return <MdVoiceChat />;
    case "vue":
      return <VueIcon />;
    case "angular":
      return <AngularIcon />;
    case "react":
      return <ReactIcon />;
    case "nextjs":
      return <NextJsIcon />;
    case "typescript":
      return <TypeScriptIcon />;
    case "redux":
      return <ReduxIcon />;
    case "apollo":
      return <ApolloIcon />;
    case "webpack":
      return <WebpackIcon />;
    case "node":
      return <NodeIcon />;
    case "sass":
      return <SassIcon />;
    case "css":
      return <Css3Icon />;
    case "html":
      return <Html5Icon />;
    case "tailwind":
      return <TailwindIcon />;
    case "jquery":
      return <JqueryIcon />;
    case "git":
      return <GitIcon />;
    case "graphql":
      return <GraphqlIcon />;
    case "java":
      return <JavaIcon />;
    case "python":
      return <PythonIcon />;
    case "postgres":
      return <PostgresqlIcon />;
    case "jest":
      return <JestIcon />;
    case "aws":
      return <AwsIcon />;
    default:
      return null;
  }
}
